DROP TABLE IF EXISTS `memberinfo`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `memberinfo` (
  `MemberInfoID` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Identity of the table',
  `MID` int(11) NOT NULL COMMENT 'The referenced ID from members table',
  `FirstName` varchar(60) DEFAULT NULL,
  `MiddleName` varchar(30) DEFAULT NULL COMMENT 'The Middle Name of the member',
  `LastName` varchar(30) DEFAULT NULL,
  `NickName` varchar(10) DEFAULT NULL,
  `Birthdate` date DEFAULT NULL COMMENT 'The birthdate of the member',
  `Gender` tinyint(4) DEFAULT NULL COMMENT 'The gender of the member (1 - Male; 2 - Female)',
  `CityID` int(11) DEFAULT NULL COMMENT 'The cityID as referenced from ref_cities',
  `RegionID` int(11) DEFAULT NULL COMMENT 'The RegionID as referenced from ref_regions',
  `Email` varchar(100) DEFAULT NULL,
  `AlternateEmail` varchar(100) DEFAULT NULL,
  `PhotoFileName` varchar(150) DEFAULT NULL,
  `MobileNumber` varchar(13) DEFAULT NULL,
  `AlternateMobileNumber` varchar(13) DEFAULT NULL,
  `NationalityID` int(11) DEFAULT NULL COMMENT 'The referenced ID from ref_nationality table',
  `OccupationID` int(11) DEFAULT NULL COMMENT 'The referenced ID from the ref_occupations table',
  `ReferrerID` int(11) DEFAULT NULL COMMENT 'The referenced ID from ref_referrer table',
  `Address1` varchar(100) DEFAULT NULL COMMENT 'The unit number, building, subdivision name address of the member',
  `Address2` varchar(100) DEFAULT NULL COMMENT 'The street address of the member',
  `IdentificationID` int(11) DEFAULT NULL COMMENT 'The referenced ID from ref_identifications table',
  `IdentificationNumber` varchar(30) DEFAULT NULL,
  `RegistrationOrigin` tinyint(4) DEFAULT NULL COMMENT 'The origin of registration (1 - Website; 2 - Kiosk (Cashier); )',
  `EmailSubscription` tinyint(4) DEFAULT '0' COMMENT 'If member subscribed for promotions and offers via Email (0 - Not Subscribed; 1 - Subscribed)',
  `SMSSubscription` tinyint(4) DEFAULT '0' COMMENT 'If member subscribed for promotions and offers via SMS (0 - Not Subscribed; 1 - Subscribed)',
  `IsSmoker` tinyint(4) DEFAULT NULL COMMENT 'If member is a smoker or non-smoker (1 - Smoker; 2 - Non-smoker; )',
  `IsCompleteInfo` tinyint(4) DEFAULT '0' COMMENT 'Check if all required information are filled (0 - Not Complete; 1 - Complete)',
  `DateCreated` varchar(26) DEFAULT NULL,
  `DateVerified` varchar(26) DEFAULT NULL COMMENT 'The date and time of verification',
  `UpdatedByAID` int(11) DEFAULT NULL COMMENT 'The AID of the user who updated the record',
  `DateUpdated` varchar(26) DEFAULT NULL,
  `ReferrerCode` varchar(20) DEFAULT NULL,
  `Status` tinyint(4) DEFAULT '1' COMMENT 'The membership status (1 - Active; 2 - Deactivated)',
  `Option1` varchar(50) DEFAULT NULL,
  `Option2` varchar(50) DEFAULT NULL,
  `Option3` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`MemberInfoID`),
  UNIQUE KEY `UK_memberinfo_Email` (`Email`),
  KEY `FK_memberinfo_members_UMID` (`UpdatedByAID`),
  KEY `IDX_memberinfo` (`FirstName`,`LastName`),
  KEY `FK_memberinfo_members_MID` (`MID`),
  KEY `FK_memberinfo_ref_nationality_NationalityID` (`NationalityID`),
  KEY `FK_memberinfo_ref_occupations_OccupationID` (`OccupationID`),
  KEY `FK_memberinfo_ref_referrer_ReferrerID` (`ReferrerID`),
  KEY `FK_ref_identifications_IdentificationID` (`IdentificationID`),
  CONSTRAINT `FK_memberinfo_members_MID` FOREIGN KEY (`MID`) REFERENCES `members` (`MID`),
  CONSTRAINT `FK_memberinfo_ref_nationality_NationalityID` FOREIGN KEY (`NationalityID`) REFERENCES `ref_nationality` (`NationalityID`),
  CONSTRAINT `FK_memberinfo_ref_occupations_OccupationID` FOREIGN KEY (`OccupationID`) REFERENCES `ref_occupations` (`OccupationID`),
  CONSTRAINT `FK_memberinfo_ref_referrer_ReferrerID` FOREIGN KEY (`ReferrerID`) REFERENCES `ref_referrer` (`ReferrerID`),
  CONSTRAINT `FK_ref_identifications_IdentificationID` FOREIGN KEY (`IdentificationID`) REFERENCES `ref_identifications` (`IdentificationID`)
) ENGINE=InnoDB AUTO_INCREMENT=48 DEFAULT CHARSET=utf8 AVG_ROW_LENGTH=819;
