DROP TABLE IF EXISTS `members`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `members` (
  `MID` int(11) NOT NULL AUTO_INCREMENT COMMENT 'The unique Member ID',
  `UserName` varchar(100) DEFAULT NULL,
  `Password` varchar(40) DEFAULT NULL,
  `Passkey` varchar(10) DEFAULT NULL,
  `DateLastLogin` varchar(26) DEFAULT NULL,
  `LoginAttempts` tinyint(4) DEFAULT '0' COMMENT 'The total number of login tries',
  `SessionNoExpire` tinyint(4) DEFAULT '0' COMMENT 'Handles accounts sessions expiration. (0 - Expires; 1 - Non-expiring)',
  `ForChangePassword` tinyint(4) DEFAULT '0' COMMENT 'Indicates if the account needs to change password or not (0 - Do not change password; 1 - Change Password)',
  `WithPasskey` tinyint(4) DEFAULT '0' COMMENT 'Whether the account will be using passkey or not. (0 - No Passkey; 1 - Uses Passkey)',
  `DateCreated` varchar(26) DEFAULT NULL,
  `DateUpdated` varchar(26) DEFAULT NULL,
  `IsVIP` tinyint(4) DEFAULT '0' COMMENT '0 - Regular; 1 - VIP',
  `Status` tinyint(4) DEFAULT '1' COMMENT 'The status of the account (1 - Active; 2 - Suspended; 3 - Locked (Attempts); 4 - Locked (Admin); 5 - Banned; 6 - Terminated)',
  PRIMARY KEY (`MID`),
  UNIQUE KEY `IX_members_UserName` (`UserName`),
  KEY `IDX_members_MID` (`MID`),
  KEY `IX_members_Passkey` (`Passkey`),
  KEY `IX_members_Password` (`Password`),
  KEY `IX_members_Status` (`Status`)
) ENGINE=InnoDB AUTO_INCREMENT=48 DEFAULT CHARSET=utf8 AVG_ROW_LENGTH=375;
/*!40101 SET character_set_client = @saved_cs_client */;

